import React, { Component } from "react";
import Particles from "react-tsparticles";
import particlesOptions from "./particles.json";
import Navigation from "./components/navigation/Navigation";
import Logo from "./components/logo/Logo";
import Clarifai from "clarifai";
import Image_input_field from "./components/image_input_field/Image_input_field";
import Rank from "./components/rank/Rank";
import Recognised_image from "./components/recognised_image/Recognised_image";
import "./App.css";

const app = new Clarifai.App({
  apiKey: "f9d0ebd6f7f643a391cb297d36b02334",
});

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: "",
    };
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  };

  onButtonSubmit = () => {
    console.log("click");
    app.models
      .predict(
        "f9d0ebd6f7f643a391cb297d36b02334",
        "https://www.crushpixel.com/big-static7/preview4/group-boys-girls-speak-talking-188903.jpg"
      )
      .then(
        function (response) {},
        function (err) {}
      );
  };

  render() {
    return (
      <div className="App">
        <Particles options={particlesOptions} />
        <Navigation />
        <Logo />
        <Rank />
        <Image_input_field
          onInputChange={this.onInputChange}
          onButtonSubmit={this.onButtonSubmit}
        />

        <Recognised_image />
      </div>
    );
  }
}

export default App;
